import React from "react";

const Icon = (props) => {
  return (
      <svg width="100%" height="100%" viewBox="0 0 32 32" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
        <path d='../icons/calendar.svg'/>
      </svg>
  );
};

export default Icon;
